import React, { Component } from "react";
import { NavLink } from "react-router-dom";
import PropTypes from "prop-types";
import "./menu.style.css";
import styled from "styled-components";

const active = {
  marginTop: "25px",
  width: "100%",
  height: "53px",
  color: "var(--greenish-teal)",
  fontSize: "22px",
  fontFamily: "NanumSquareEB",
  textAlign: "center",
  textDecoration: "none",
  borderLeft: "5px solid var(--greenish-teal)",
};

const Menu = () => {
  return (
    <div>
      <div className="menu-container">
        <NavLink className="link-list" to="home" activeStyle={active}>
          홈
        </NavLink>
        <NavLink className="link-list" activeStyle={active} to="/home/news">
          뉴스
        </NavLink>
        <NavLink
          className="link-list"
          activeStyle={active}
          to="/home/portfolio"
        >
          보유주식
        </NavLink>
        <NavLink className="link-list" activeStyle={active} to="/home/opinion">
          오피니언
        </NavLink>
      </div>
    </div>
  );
};

export default Menu;
